Diary of a Wimpy Kid (2010)  

Verenigde Staten
Komedie
94 minuten

geregisseerd door Thor Freudenthal
met Zachary Gordon, Steve Zahn en Robert Capron

We volgen Greg Heffley (Zachary Gordon), een bijdehante basisschool leerling, en de problemen die &quot;middle-school&quot; voor hem oplevert. Hij wordt daarbij gesteund door zijn vader Frank (Steve Zahn) en zijn beste vriend Rowley (Robert Capron). We zien aan de hand van zijn dagboek en tekeningen alle gebeurtenissen gedurende het schooljaar. Gebaseerd op de gelijknamige boeken van Jeff Kinney.

